import React from 'react';

import './Footer.scss';

export default function Footer({ dataWeatherCity, directionWind }) {
    return (
        <footer className="Footer">
            <div className="Footer__data">
                <div>Ветер</div>
                {Object.keys(dataWeatherCity).length !== 0 ? <div>{dataWeatherCity.wind.gust} м/с, {directionWind}</div> : <></>}
            </div>
            <div className="Footer__data">
                <div>Давление</div>
                {dataWeatherCity ? <div>{dataWeatherCity.main.grnd_level} мм рт.ст.</div> : <></>}
            </div>
            <div className="Footer__data">
                <div>Влажность</div>
                {dataWeatherCity ? <div>{dataWeatherCity.main.humidity}%</div> : <></>}
            </div>
            <div className="Footer__data">
                <div>Вероятность дождя</div>
                {dataWeatherCity ? <div>10%</div> : <></>}
            </div>
      </footer>
    );
}
